import LOGO from "../../images/logo.png";
import "./Nav.module.css";

const Nav = ({ authToken }) => {
  return (
    <nav>
      <div className="logo-container">
        <div>
          <img className="logo" src={LOGO} alt="logo" />
          <h1>Tinder</h1>
        </div>
      </div>
      {!authToken && <button>Log in</button>}
    </nav>
  );
};

export default Nav;
